// Check for days to show progressive profile

module.exports = ({ params }) => {
    const lastChangeDate = params.lastChangeDate;
    const progressiveProfileDate = params.progressiveProfileDate;

    console.log("Time to ask to update your profile");

    function getDaysUntilDate(lastChangeDate) {
      const changeDate = new Date(lastChangeDate);
      const todayDate = new Date();
      console.log("Today's date:", todayDate);

      const timeDifference = todayDate.getTime() - changeDate.getTime();
      const daysDifference = Math.floor(timeDifference / (1000 * 3600 * 24));
      console.log("Number of days since", lastChangeDate, ":", daysDifference);

      const profileDays = progressiveProfileDate - daysDifference;
      console.log("Number of days until profile update required:", profileDays);

      return profileDays;
    }

    const daysUntilProfileDate = getDaysUntilDate(lastChangeDate);
    return { 'daysUntilExpire': daysUntilProfileDate };
};

